rating_pattern = r'<span class="styles_restaurantMetaRating__3MhTg">(.*?)<\/span>'
price_pattern = r'<span class="rupee">([0-9.]+)<\/span>'
link_pattern = r'<a href="(.*?)"'

# Extract restaurant name
restaurant_name = re.findall(restaurant_name_pattern, data)

